#* {{quote-book|en|year=1594|author=Christopher Marlowe|title=Massacre at Paris|chapter=|edition=|url=http://www.gutenberg.org/etext/1496
|passage=The guider of all crownes, Graunt that our deeds may wel deserve your loves: And so they shall, if fortune speed my will, And '''yeeld''' our thoughts to height of my desertes.}}
#* {{quote-book|en|year=1577|author=Raphael Holinshed|title=Chronicles of England, Scotland and Ireland (2 of 6): England (2 of 12)|chapter=|edition=|url=http://www.gutenberg.org/etext/16748
|passage=This doone, {{...|he goeth with a mightie armie into Kent, where the sedition began, and first comming to the castell of Tunbridge,}} he compelled capteine Gilbert to '''yeeld''' vp the fortresse into his hands.}}
#* {{quote-book|en|year=1676|author=Izaak Walton|title=The Compleat Angler|chapter=|edition=|url=http://www.gutenberg.org/etext/9198
|passage={{...|Of which my next shall be to tell you, it is certain, that certain fields neer ''Lemster'', a Town in ''Herefordshire'', are observed, that they make the Sheep that graze upon them more fat then the next, and also to bear finer Wool; that is to say, that that year in which they feed in such a particular pasture,}} they shall '''yeeld''' finer wool then the yeer before they came to feed in it, and courser again if they shall return to their former pasture, and again return to a finer wool being fed in the fine wool ground.}}
